const HomeSpecialtySection = ({ specialties }) => {
  if (!specialties || specialties.length === 0) {
    return (
      <section className="mb-16">
        <h2 className="text-2xl font-bold mb-6">Chuyên khoa phổ biến</h2>
        <div className="text-slate-500 italic">
          Chưa có dữ liệu chuyên khoa
        </div>
      </section>
    );
  }

  return (
    <section className="mb-16">
      <h2 className="text-2xl font-bold mb-6">Chuyên khoa phổ biến</h2>

      <div className="grid grid-cols-2 sm:grid-cols-4 lg:grid-cols-8 gap-4">
        {specialties.map(item => (
          <div key={item.id} className="bg-white p-4 rounded shadow text-center">
            <div>{item.name}</div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default HomeSpecialtySection;
